import React from 'react';
// import {NavLink} from 'react-router-dom'
import Menu from './Menu';

const Home = ()=>{
    return(
        <>
            <a href="/">Home</a><br/>
            <a href="/about">About</a><br/>
            <a href="/user">User</a>
            <h1>i am home</h1>
        </>
    );
}

export default Home;
